const rounds = {
    FourBoulderOnsight: {
        numBoulders: 4,
        activeTime: 4,
        restTime: 4,
    },
    ThreeBoulderOnsight: {
        numBoulders: 3,
        activeTime: 4,
        restTime: 4,
    },
    FiveBoulderOnsight: {
        numBoulders: 5,
        activeTime: 4,
        restTime: 4,
    },
    SixBoulderOnsight: {
        numBoulders: 6,
        activeTime: 4,
        restTime: 4,
    }
}

function getRound(round) {
    for(let i in rounds) {
        if(i === round) {
            return i
        }
    }
}

getRound('ThreeBoulderOnsight')
